// Home.js
import React, { useEffect, useState } from 'react';
import './Home.css';

function Home({ userId }) {
  const [relatedProducts, setRelatedProducts] = useState([]);
  const [topRated, setTopRated] = useState([]);
  const [activeTab, setActiveTab] = useState('related');

  useEffect(() => {
    if (userId) {
      fetchRelatedProducts();
    }
    fetchTopRatedProducts();
  }, [userId]);

  const fetchRelatedProducts = async () => {
    try {
      const res = await fetch(`http://localhost:5000/api/related-products/${userId}`);
      const data = await res.json();
      setRelatedProducts(data);
    } catch (error) {
      console.error('Error fetching related products:', error);
    }
  };

  const fetchTopRatedProducts = async () => {
    try {
      const res = await fetch(`http://localhost:5000/api/top-rated-products`);
      const data = await res.json();
      setTopRated(data);
    } catch (error) {
      console.error('Error fetching top-rated products:', error);
    }
  };

  const handleAddToCart = (product) => {
    // Add your cart logic here
    console.log('Adding to cart:', product);
  };

  const handleProductClick = (prodId) => {
    // Navigate to product detail page
    console.log('Product clicked:', prodId);
  };

  const getValidImageUrl = (url) => {
    return url && url.startsWith('http') ? url : 'https://via.placeholder.com/200';
  };

  return (
    <div className="home-container">
      <h1>Recommended For You</h1>

      {/* Tabs for Recommendations */}
      <div className="tabs-container">
        <div className="tab-buttons">
          <button
            className={`tab-btn ${activeTab === 'related' ? 'active' : ''}`}
            onClick={() => setActiveTab('related')}
          >
            Products You May Like
          </button>
          <button
            className={`tab-btn ${activeTab === 'topRated' ? 'active' : ''}`}
            onClick={() => setActiveTab('topRated')}
          >
            Top Rated
          </button>
        </div>

        <div className="tab-content">
          {activeTab === 'related' && (
            <div className="product-grid">
              {relatedProducts.map((item) => (
                <div key={item.ProdID} className="product-card">
                  <img src={getValidImageUrl(item.ImageURL)} alt={item.Name} className="product-image" />
                  <div className="product-info">
                    <h2>{item.Name}</h2>
                    <p>{item.Brand}</p>
                    <p>Rating: {item.Rating} ⭐</p>
                    <p>{item.ReviewCount} reviews</p>
                    <button className="add-to-cart-button" onClick={() => handleAddToCart(item)}>Add to Cart</button>
                  </div>
                </div>
              ))}
            </div>
          )}

          {activeTab === 'topRated' && (
            <div className="product-grid">
              {topRated.map((rec, index) => (
                <div key={index} className="product-card" onClick={() => handleProductClick(rec.ProdID)}>
                  <img src={getValidImageUrl(rec.ImageURL)} alt={rec.Name} className="product-image" />
                  <div className="product-info">
                    <h2>{rec.Name}</h2>
                    <p>{rec.Brand}</p>
                    <p>Rating: {rec.Rating} ⭐</p>
                    <p>{rec.ReviewCount} reviews</p>
                    <button className="add-to-cart-button" onClick={() => handleAddToCart(rec)}>Add to Cart</button>
                  </div>
                </div>
              ))}
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default Home;
